var e="undefined"!=typeof globalThis?globalThis:"undefined"!=typeof self?self:"undefined"!=typeof window?window:"undefined"!=typeof global?global:{},a={},o={},n=e.parcelRequire1f3a;null==n&&((n=function(e){if(e in a)return a[e].exports;if(e in o){var n=o[e];delete o[e];var i={id:e,exports:{}};return a[e]=i,n.call(i.exports,i,i.exports),i.exports}var s=new Error("Cannot find module '"+e+"'");throw s.code="MODULE_NOT_FOUND",s}).register=function(e,a){o[e]=a},e.parcelRequire1f3a=n),n.register("1WG2w",(function(e,a){e.exports=JSON.parse('[{"id":"1","nom":"Level 42","components":["Mark King","Mike Lindup","Philip Gould","Boon Gould"],"estil":"Jazz Funk, Rock, Acid Jazz, Synthpop","anyFundacio":"1979","historia":"Level 42 es una banda británica y de estilo funk-pop. El grupo tuvo gran éxito en el Reino Unido y en el resto del mundo durante los 80. La banda ganó fama por la calidad de músicos como Mark King, cuya técnica magistral de tocar el bajo fue un trampolín para muchos éxitos de la banda.<br><br>Los miembros fundadores de la banda fueron Mark King, Mike Lindup y los hermanos Boon Gould y Philip Gould. El teclista de estudio Wally Badarou contribuyó a muchos de sus primeros éxitos, y es considerado por muchos el quinto miembro del grupo, aunque nunca se unió oficialmente. Otros miembros a tiempo completo que han colaborado a lo largo de los años fueron Alan Murphy, Gary Husband, Jakko Jakszyk, Nathan King, Lyndon Connah y Sean Freeman.<br><br>La banda aún realiza conciertos en directo (con Mark King a la cabeza y con variaciones en su formación original), y su nuevo álbum, Retroglide, estuvo previsto para ser lanzado el 18 de septiembre de 2006.","discografia":[{"album":"Level 42","any":"1980"},{"album":"Strategy/The Early Tapes","any":"1982"},{"album":"The Pursuit of Accidents","any":"1983"},{"album":"Standing in the Light","any":"1983"},{"album":"True Colours","any":"1984"},{"album":"World Machine","any":"1985"},{"album":"Running In The Family","any":"1987"},{"album":"Staring At The Sun","any":"1988"},{"album":"Guaranteed","any":"1991"},{"album":"Forever Now","any":"1994"},{"album":"Retroglide","any":"2006"},{"album":"Sirens","any":"2013"}],"fotoGrup":"level42.jpg","web":"level42.com","credits":"wikipedia"},{"id":"2","nom":"Coldplay","components":["Chris Martin","Jonny Buckland","Guy Berryman","Will Champion"],"estil":"Pop rock,rock alternativo, post-britpop, pop","anyFundacio":"1996","historia":"Coldplay es una banda de rock británica formada en Londres en 1996. Está formada por el vocalista y pianista Chris Martin, el guitarrista Jonny Buckland, el bajista Guy Berryman, el baterista Will Champion y el director creativo Phil Harvey. Se conocieron en University College London y comenzaron a tocar música juntos desde 1996 hasta 1998, primero llamándose a sí mismos Pectoralz y luego Starfish. <br> Después de lanzar de forma independiente un EP, Safety (1998), Coldplay firmó con Parlophone en 1999. El álbum debut de la banda, Parachutes (2000), incluyó su exitoso sencillo \'Yellow\' y recibió un Brit Award por Álbum Británico del Año, un Grammy Premio al Mejor Álbum de Música Alternativa y nominación al Premio Mercury. Su segundo álbum, A Rush of Blood to the Head (2002), ganó los mismos elogios e incluyó los sencillos \'The Scientist\' y \'Clocks\', y este último ganó un premio Grammy por Grabación del año. Destacado por una producción problemática, el tercer álbum de la banda, X&Y (2005), fue el más vendido del año en todo el mundo, un logro repetido por su sucesor, Viva la Vida or Death and All His Friends (2008), que los vio explorar nuevos estilos musicales. territorio tras la finalización de lo que se consideró una trilogía. Recibió un premio Grammy al Mejor Álbum de Rock y su primera nominación al Álbum del Año, mientras que la canción principal se convirtió en el primer sencillo de un grupo británico en alcanzar el número uno tanto en el Reino Unido como en los Estados Unidos en el siglo XXI. <br> Desde entonces, Coldplay diversificó aún más su sonido con los lanzamientos posteriores Mylo Xyloto (2011), Ghost Stories (2014), A Head Full of Dreams (2015), Everyday Life (2019) y Music of the Spheres (2021). Cada álbum presentaba un tema único y añadía nuevos estilos musicales al repertorio original de la banda, incluyendo electrónica, ambient, pop, R&B, funk, clásica, jazz fusión y rock progresivo. También son conocidos por sus presentaciones en vivo \'eufóricas\',que NME dijo que es cuando la banda \'cobra vida y tiene más sentido\'. Para celebrar su vigésimo aniversario en 2018, se estrenó en cines seleccionados un documental que abarca toda la carrera dirigido por Mat Whitecross, que presenta imágenes detrás de escena nunca antes vistas. <br>Con 100 millones de álbumes vendidos en todo el mundo, Coldplay es la banda más exitosa del siglo XXI y uno de los actos musicales más vendidos de todos los tiempos.Nota Según Fuse, también es el sexto grupo más premiado de la historia. Otros logros notables incluyen la sexta gira más taquillera de todos los tiempos, tres de los 50 álbumes más vendidos en el Reino Unido, la mayor cantidad de discos número uno en el país sin perder nunca la cima,la mayoría de las nominaciones y victorias para una banda en la historia de los Brit Awards y convertirse en el primer grupo británico en debutar en el número uno en el Billboard Hot 100. Coldplay también se considera una de las bandas más influyentes del siglo XXI, y Forbes los describe como el estándar. para la escena alternativa actual. El Salón de la Fama del Rock and Roll incluyó A Rush of Blood to the Head en su lista de \'200 Álbumes Definitivos\' y el sencillo \'Yellow\' forma parte de su exhibición \'Songs That Shaped Rock and Roll\' por ser uno de los más exitosos y grabaciones importantes en la industria. A pesar de su popularidad e impacto, Coldplay se ha ganado la reputación de ser íconos musicales polarizantes.","discografia":[{"album":"Parachutes","any":"2000"},{"album":"A Rush of Blood to the Head","any":"2002"},{"album":"X&Y","any":"2005"},{"album":"Viva la Vida or Death and All His Friends","any":"2008"},{"album":"Mylo Xyloto","any":"2011"},{"album":"Ghost Stories","any":"2014"},{"album":"A Head Full of Dreams","any":"2015"},{"album":"Everyday Life","any":"2019"},{"album":"Music of the Spheres","any":"2021"}],"fotoGrup":"coldplay.jpg","web":"coldplay.com","credits":"wikipedia"},{"id":"3","nom":"Bee Gees","components":["Barry Gibb","Robin Gibb","Maurice Gibb"],"estil":"Discopop, rockpop, pop, barrocopop, psicodélicosoft, rock","anyFundacio":"1958","historia":"Bee Gees fue un grupo musical británico de pop rock formado por los hermanos Barry, Robin y Maurice Gibb en 1958. Conocidos como los «reyes de la música disco», gozaron de su mayor fama entre 1967 y 1979, con varios temas donde destaca el característico falsete del grupo.<br><br>En el álbum doble Saturday Night Fever, banda sonora de la película homónima, los Bee Gees aportaron las seis canciones principales. Al vender más de 22 millones de copias, se convirtieron en uno de los grupos más exitosos de toda la historia de la música.<br><br>Algunas de sus canciones más populares son: How deep is your love, How Can You Mend a Broken Heart, To Love Somebody, I Started a Joke, Words, Massachusetts, Nights on Broadway, Jive Talkin\', Wind of change, More than a woman, Night Fever, Run to Me, Stayin\' Alive, Tragedy, Too Much Heaven, Alone, You Win Again, You Should Be Dancing, Still Waters, I surrender, entre otras.<br><br>Billboard situó tres de sus sencillos entre los mejores de todos los tiempos en el listado Hot 100 y ubicó a How deep is your love, Night Fever y Stayin Alive en las posiciones #25, #42 y #59.<br><br>Los Bee Gees abarcaron gran parte de la escena musical, en especial con la fiebre disco durante la segunda mitad de los 1970, de la mano del productor Robert Stigwood. Se ubican entre los más importantes artistas del género musical. Su gran influencia en la industria musical fue reconocida en 2003, al convertirse en la primera y hasta hoy única banda en poseer un premio Grammy Legend.<br><br>La banda cesó su actividad en 2003 tras la muerte del hermano menor, Maurice. Como supervivientes, Barry y Robin anunciaron que el nombre Bee Gees ya no se usaría en presentaciones tras la pérdida de un integrante; sin embargo, el 7 de septiembre de 2009, Robin le reveló a Jonathan Agnew que estuvo hablando con Barry y decidieron volver a los escenarios. Luego, en 2012 falleció Robin tras una lucha con el cáncer y, con Barry solo, la etapa de los Bee Gees se cerró definitivamente.<br><br>Bee Gees fue uno de los grupos más exitosos en la historia de la música, con más de 40 años de actividad ininterrumpida. Han vendido más de 220 millones de copias a nivel mundial, entre álbumes y sencillos.","discografia":[{"album":"The Bee Gees Sing and Play 14 Barry Gibb Songs","any":"1965"},{"album":"Spicks and Specks","any":"1966"},{"album":"Bee Gees\' 1st","any":"1967"},{"album":"Horizontal","any":"1968"},{"album":"Idea","any":"1968"},{"album":"Odessa ","any":"1969"},{"album":"Cucumber Castle","any":"1970"},{"album":"2 Years On","any":"1970"},{"album":"Trafalgar","any":"1971"},{"album":"To Whom It May Concern","any":"1972"},{"album":"Life in a Tin Can","any":"1973"},{"album":"Mr. Natural","any":"1974"},{"album":"Main Course","any":"1975"},{"album":"Children of the World","any":"1976"},{"album":"Saturday Night Fever","any":"1977"},{"album":"Spirits Having Flown","any":"1979"},{"album":"Living Eyes","any":"1981"},{"album":"E.S.P.","any":"1987"},{"album":"One","any":"1989"},{"album":"High Civilization","any":"1991"},{"album":"Size Isn\'t Everything","any":"1993"},{"album":"Still Waters","any":"1997"},{"album":"This Is Where I Came In","any":"2001"}],"fotoGrup":"beegees.jpg","web":"beegees.com","credits":"wikipedia"},{"id":"4","nom":"Eagles","components":["Don Henley","Joe Walsh","Timothy B. Schmit"],"estil":"Rock ,Country rock, Hard rock, Soft rock","anyFundacio":"1971","historia":"Eagles es una banda estadounidense de country rock y hard rock formada en Los Ángeles, California, EE. UU., en 1971, hasta el 2016, en que finalizó la carrera de la banda, con la muerte de uno de los fundadores y su vocalista Glenn Frey.1​La banda es mayormente conocida por su canción “Hotel California” de 1976, acreditada por Don Felder y Don Henley.<br><br>Inicialmente su música era una mezcla entre country e instrumentación bluegrass con armonías de surf rock californiano. El resultado fueron baladas sensibles y música con cierto toque country y pop rock. Sus letras hablaban de coches, relaciones y vidas sin rumbo. Los inventores de este género fueron cantautores como Gram Parsons, Jackson Browne, J.D. Souther y Warren Zevon.<br><br>Eagles encajaron el espíritu del cantautor en el marco de una formación musical, con un marcado énfasis en los arreglos y en la maestría musical, y el sonido inicial del grupo llegó a ser sinónimo del country rock del sur de California. En álbumes posteriores, el grupo prescindió de la instrumentación bluegrass y se movió hacia un sonido claramente más roquero.<br><br>Con cinco sencillos y seis álbumes números uno, Eagles están entre los más destacados grupos de estudio de los años 1970. Al final del siglo XX, dos de sus álbumes, Their Greatest Hits (1971-1975) y Hotel California, quedaron clasificados entre los 20 álbumes superventas de EE. UU., según la RIAA estadounidense. Asimismo, según la revista Rolling Stone en 2004, el álbum Hotel California está clasificado entre los 500 mejores de todos los tiempos, y el grupo ocupa el número 75 en la lista de los 100 mayores artistas de todos los tiempos.2​ Hasta la muerte de Michael Jackson en 2009, hecho que aumentó las ventas de su álbum Thriller, tenían en su haber el álbum más vendido de EE. UU.: Their Greatest Hits (1971-1975).<br><br>Eagles se separaron en 1980, pero volvieron a juntarse en 1994 para dar un concierto acústico, registrado en el álbum Hell Freezes Over, una mezcla de temas clásicos y nuevos. Han estado de gira desde entonces, y entraron en el Rock and Roll Hall of Fame en 1998. En 2007, Eagles lanzó Long Road Out of Eden, su primer álbum de estudio, después de 28 años. Al año siguiente emprendieron la gira Long Road out of Eden Tour, que transcurrió en el año 2009 a través de Norteamérica y Europa. El primer concierto fue el 20 de marzo del 2008 en Londres, Inglaterra, y el último el 22 de julio de 2009 en Lisboa, Portugal, dando dos conciertos adicionales el 17 y 20 de abril de 2010 en Los Ángeles, California.","discografia":[{"album":"Eagles","any":"1972"},{"album":"Desperado","any":"1973"},{"album":"On the Border","any":"1974"},{"album":"One of These Nights","any":"1975"},{"album":"Hotel California","any":"1976"},{"album":"The Long Run","any":"1979"},{"album":"Long Road Out Of Eden","any":"2007"}],"fotoGrup":"eagles.jpg","web":"eagles.com","credits":"wikipedia"},{"id":"5","nom":"Depeche Mode","components":["Dave Gahan","Martin Gore"],"estil":"Synth-pop​, Dark wave, Electrónica, Música industrial, New wave, Rock alternativo, Rock electrónico, Dance-rock","anyFundacio":"1980","historia":"Depeche Mode es una banda británica de música electrónica formada en 1980 por Vince Clarke, Andrew Fletcher, Martin Gore y David Gahan. Después de su álbum debut Speak & Spell en 1981, Clarke dejó el grupo y fue sustituido por Alan Wilder, quien permaneció hasta 1995, tras lo cual Gahan, Gore y Fletcher continuaron como trío hasta el fallecimiento de Fletcher en 2022, pese a lo cual Gahan y Gore siguen con el proyecto.<br><br>Según el documental Historia del rock de la BBC \'son los padres del rock electrónico\'; está considerado uno de los mejores exponentes del género, siendo importantes precursores del uso del sintetizador como instrumento y del sampler como recurso musical, así como de la realización de videos musicales. Ha vendido más de 120 millones de álbumes, sumando el total de ventas de sus discos en todo el mundo, incluyendo sencillos, convirtiéndose en el más exitoso grupo de música electrónica en la historia. También fue elegido entre los 50 mejores grupos de música de todos los tiempos y uno de los 10 más influyentes de la música contemporánea.<br><br>Según la revista Q, es «la banda de rock electrónico más popular que el mundo ha conocido»y de acuerdo con el Sunday Telegraph es «uno de los más grandes grupos de pop británico de todos los tiempos».","discografia":[{"album":"Speak & Spell","any":"1981"},{"album":"A Broken Frame","any":"1982"},{"album":"Construction Time Again","any":"1983"},{"album":"Some Great Reward","any":"1984"},{"album":"Black Celebration","any":"1986"},{"album":"Music for the Masses","any":"1987"},{"album":"Violator","any":"1990"},{"album":"Songs of Faith and Devotion","any":"1993"},{"album":"Ultra","any":"1997"},{"album":"Exciter","any":"2001"},{"album":"Playing the Angel","any":"2005"},{"album":"Sounds of the Universe","any":"2009"},{"album":"Delta Machine","any":"2013"},{"album":"Spirit","any":"2017"},{"album":"Memento Mori","any":"por publicarse en 2023"}],"fotoGrup":"depechemode.jpg","web":"dm.com","credits":"wikipedia"},{"id":"6","nom":"Kool and The Gang","components":["",""],"estil":"R&B, Soul, Disco, Funk, Jazz","anyFundacio":"1964","historia":"Los miembros principales del grupo a través de los años han sido Robert \'Kool\' Bell en el bajo y Ronald Bell en el saxo tenor; George Brown en la batería; Robert Mickens en la trompeta; Dennis Thomas en el saxo alto; Claydes Charles Smith en la guitarra, Clifford Adams en el trombón y Rick Westfield en los teclados.<br><br>El padre de Robert y Ronald trabajó con Thelonious Monk y así mismo los hermanos eran amigos de Leon Thomas. En 1964 Robert formó la banda instrumental \'The Jazziacs\' con cinco compañeros de colegio y después cambiaron su nombre a Kool & the Gang cuando lanzaron un álbum del mismo nombre en 1969.<br><br>Aunque no llegaron a poner un sencillo en listas, el álbum fue exitoso, lo que les permitió seguir editando álbumes hasta que el de 1973 llamado Wild and Peaceful llegó al reconocimiento general con las canciones \'Jungle Boogie\' y \'Hollywood Swinging\'. El sonido funk que habían estado cultivando llegó a su máxima expresión en el álbum de 1975 llamado The Spirit of the Boogie y después de este empieza un cambio radical hacia el sonido disco.<br><br>Entre 1973 y 1978, Kool & The Gang es reconocida como una de las bandas más creativas del jazz-funk. En los últimos años 70, la música disco estaba en pleno apogeo y muchos grupos están recurriendo a la música funk uno menos elaborado y más \'pop\' para llegar a un público más amplio. Es en este contexto que en 1978 James \'JT\' Taylor se unió a la banda como cantante y Eumir Deodato como productor: la receta del éxito.<br><br>Para en ese entonces se une al grupo el cantante James \'J.T.\'Taylor en el álbum Ladies\' Night comienza una nueva etapa más comercial y en consecuencia más exitosa, obtuvieron un número 1 con \'Celebration\' del álbum Celebrate! del año 1980, producido por Eumir Deodato.<br><br>\'Ladies Night\'(vendió más de un millón de discos en los EE. UU.), \'Too Hot\', \'Hangin \'Out\'. Los años 80 fueron los años de gloria del grupo donde varios de sus temas encabezaron distintas listas. En esta época de éxitos como \'Celebration\'(1980), \'Get Down On It\'(1981), \'Cherish\'(1985) o \'Fresh\'(1984) y \'Victoria\'(1986). La canción \'Celebration\'(2 millones de copias vendidas en los EE. UU.) es elegido como himno de bienvenida para los rehenes estadounidenses en Irán.<br><br>A partir de ese éxito lograron muchas más apariciones en listas como \'Big Fun\', \'Get Down on It\'y \'Joanna\'. Su álbum de 1984 llamado Emergency les dio cuatro éxitos en el top 20 incluyendo \'Fresh\' y \'Cherish\'. Su presencia en listas se interrumpió a partir del álbum Forever cuando Taylor y Ronald Bell (quien pasó a llamarse Khalis Bayyan) dejaron el grupo. En 1987 que hay un punto de inflexión, con la salida de Taylor. Oficialmente, se separarían de manera amistosa, pero más tarde algunos de los miembros fundadores acusaron a Taylor de quedarse con varios de sus éxitos.<br><br>El nombre del grupo volvió a la actualidad en 1994, cuando la canción Jungle Boogie fue incluida dentro del exitoso filme de Quentin Tarantino, Pulp Fiction en donde actuaban John Travolta, Uma Thurman y Samuel Jackson.<br><br>Al ser un grupo legendario del R&B, productores de Hip Hop han incluido algunos de sus tonos en sus creaciones, como lo hizo Jazzy Jeff para el hit Summertime de DJ Jazzy Jeff & The Fresh Prince (con Will Smith al micrófono), el cual contiene un sample del etéreo y semi-jazzero tema Summer Madness. Madonna incluyó otro sample del grupo en su polémica canción \'Erotica\', el sample provenía de la canción Jungle Boogie, las trompetas del comienzo y del medio fueron usadas en casi toda la canción.<br><br>Entre 1989 y 1993, Taylor lanzó tres álbumes en solitario: \'Master of the Game\', \'Feel the Need\'y \'Baby I\'m Back\', conduciendo éxito en (Estados Unidos) con títulos como \'Sister Rosa\', \'Days a Week\' o \'Night Long Hot Summer\'.<br><br>Por su parte, los restantes miembros de Kool & The Gang reemplazaron a Taylor con tres vocalistas: Skip Martin (exmiembro de la banda Dazz, y también una trompetista), Odeen Mays (también claviettiste) y Gary Brown. Sin embargo el público estaba acostumbrado a la voz y la imagen de Taylor, y los álbumes \'Sweat\'(1989) y \'Unite\'(1993) no logran escalar en las listas.<br><br>En 1995, bajo la presión de los fanes, Taylor volvió al grupo: con una larga gira internacional, que termina en marzo de 1999. Ellos grabaron el álbum \'State of Affairs\'(1996), pero la difusión es escasa. Sin embargo, la versión DJs remix de \'Celebration\' y \'Get Down On It\' se cuelan en lo alto de las listas del Reino Unido. Una vez más, Taylor dejó la banda para reiniciar su carrera en solitario en 2000, lanzó el álbum \'A Brand New Me\', con dos singles exitosos \'On The Beach\'y \'How\'.<br><br>El grupo vuelve formado por cuatro miembros originales, y continúa realizando conciertos por todo el mundo. Charles \'Claydes\' Smith, guitarrista y miembro fundador, murió en enero de 2007. Sin embargo Kool and the Gang siguen volando el cartel de \'no hay billetes\' en sus conciertos por todo el mundo. En ellos alternan sus canciones de \'jazz\' de los 70, con sus hits de los 80 y nuevos títulos. En julio de 2007, la banda lanzó el álbum \'Still Kool\', que alterna el jazz, soul, funk, rock y RnB moderno. Taylor sigue haciendo conciertos, principalmente en los EE. UU. y lanza un nuevo álbum en 2008.<br><br>También es justo mencionar la dimensión instrumental de esta formación, con canciones como \'Messenger Of Wisdom\', \'Summer Madness / Winter sadness\'o \' I Remember John Coltrane","discografia":[{"album":"Kool & The Gang","any":"1969"},{"album":"Live at the Sex Machine","any":"1971"},{"album":"Live at PJ\'s","any":"1971"},{"album":"Music is the Message","any":"1972"},{"album":"Good Times","any":"1973"},{"album":"Wild and Peaceful","any":"1973"},{"album":"Light of Worlds","any":"1974"},{"album":"Spirit of the Boogie","any":"1975"},{"album":"Open Sesame","any":"1976"},{"album":"Love & Understanding","any":"1976"},{"album":"Behind the Eyes","any":"1977"},{"album":"The Force","any":"1978"},{"album":"Ladies\' Night","any":"1979"},{"album":"Celebrate!","any":"1980"},{"album":"Something Special","any":"1981"},{"album":"As One","any":"1982"},{"album":"In the Heart","any":"1983"},{"album":"Emergency","any":"1984"},{"album":"Forever","any":"1987"},{"album":"Sweat","any":"1989"},{"album":"Unite","any":"1993"},{"album":"State of Affairs","any":"1996"},{"album":"Gangland","any":"2001"},{"album":"Still Kool","any":"2007"},{"album":"Perfect union","any":"2021"}],"fotoGrup":"koolandthegang.jpg","web":"koolandthegang.com","credits":"wikipedia"},{"id":"7","nom":"Robert Miles","components":["Roberto Concina"],"estil":"Trance, electrónica, ambient, techno, chill-out","anyFundacio":"1984","historia":"Robert Miles era hijo de inmigrantes italianos en Suiza; Antonietta y Albino Concina.<br><br>Miles se convirtió en un experto en el piano durante su infancia y se introdujo a la escena musical en 1988. Trabajó como DJ en algunos clubes italianos, y en 1990 usó sus ahorros para establecer su propio estudio y comprar equipo usado.<br><br>En 1994, Miles escribió su composición más famosa: Children. El sencillo tomó popularidad lentamente, en las primeras dos semanas de estar a la venta. En 1995, vendió más de 30 000 copias en Europa y encabezó las listas de popularidad de muchos países. Le dio a Miles disco de platino en Inglaterra y Alemania y disco de oro en otros países. Fue considerado como el sencillo más exitoso de 1996. En diciembre de 2004, Children alcanzó nueva audiencia en Inglaterra al ser usado en una colaboración entre Angel City y Ministry of Sound bajo la custodia de Dj MyR titulada \'Do You Know?\', que alcanzó entrar al Top 5 del Reino Unido. Cuenta el propio DJ que compuso este tema en un \'búnker\' de 4 metros cuadrados que él mismo diseñó en el garaje familiar, inspirado por la atrocidad de las muertes infantiles en la guerra de Yugoslavia.<br><br>El siguiente sencillo de Miles fue Fable, con la voz de Fiorella Quinn. Su álbum debut, Dreamland, fue lanzado el 7 de junio de 1996 en Europa mientras la canción era un éxito, unos días después salió a la venta en los Estados Unidos con una canción adicional One and One cantada por Maria Nayler y escrita por Billy Steinberg, Rick Nowels y Marie Claire D\'ubaldo. Esta canción fue muy popular y después fue lanzada como sencillo en Estados Unidos y Alemania. A finales de 1996, Miles lanzó una nueva versión de Dreamland, llamada Dreamland - The Winter Edition en Alemania, que contenía la canción One and One (que no había sido incluida en la versión original de Dreamland en Europa). La canción fue escrita inicialmente para la cantante polaca Edyta Górniak, pero esta la grabó hasta un año después y fue incluida en su álbum debut.<br><br>En noviembre de 1997, Miles lanzó la canción Freedom como nuevo sencillo de su segundo álbum 23am, lanzado el 27 de noviembre de 1997. Conteniendo un sentido diferente a Dreamland, 23am incorporó más canciones con voz mientras mantenía la esencia de Miles con el piano. Fue en este tiempo cuando trabajó junto a Richard D. James bajo el nombre de Aphex Twin.<br><br>Miles estuvo en receso hasta el 11 de junio de 2001 cuando lanzó su nuevo álbum, Organik, que fue presentado en vinil y CD. El nuevo sencillo fue Paths y es considerado por muchos fans como un cambio radical en el estilo musical de Miles.<br><br>En 2003, un álbum de remixes fue lanzado con el nombre de Organik Remixes, conteniendo las canciones ganadoras del concurso que Miles sostuvo en su página web y algunos remixes de artistas como The Future Sound of London. También se incluyó una canción de Miles titulada Bhairav, cantada por Amelia Cuni.<br><br>A finales de 2003, Miles cambió su residencia a Los Ángeles, ahí inició su casa productora S:alt Records y en 2004 lanzó un álbum creado con Trilok Gurtu, titulado Miles Gurtu. Tenía su residencia en Ibiza desde hacía varios años, donde creó la emisora de radio en línea OpenLab que él definía como \'un proyecto de vanguardia que reúne a la cultura, las artes, los medios de comunicación, la tecnología y la innovación\'.<br><br>De hecho, era un habitual de la isla, donde en el año 2016 pinchó en algunas de sus discotecas (Heart) y donde tenía previsto participar en el International Music Summit. Falleció en Ibiza el 9 de mayo de 2017, a los 47 años de edad, debido a un cáncer en fase 4 de metástasis.","discografia":[{"album":"Dreamland","any":"1996"},{"album":"23am","any":"1997"},{"album":"Organik","any":"2001"},{"album":"Miles_Gurtu (con Trilok Gurtu)","any":"2004"},{"album":"Th1rt3en","any":"2011"}],"fotoGrup":"robermiles.jpg","web":"robermiles.com","credits":"wikipedia"},{"id":"8","nom":"Erasure","components":["Andrew Ivan Bell","Vince Clarke"],"estil":"Synth-pop, Electropop, dance","anyFundacio":"1985","historia":"Erasure es un dúo británico de synthpop y electropop que ha destacado como uno de los grupos más populares en la historia de la música pop. La banda está conformada por el compositor y tecladista Vince Clarke y el cantante y letrista Andy Bell. En el año 1989, Erasure es nominado y obtiene el Brit Awards otorgado por la Industria Fonográfica Británica como el Mejor Grupo Británico.<br><br>Con 35 años de carrera y más de 28 millones de discos vendidos, 14 álbumes top 20, de los cuales 10 han sido top 10, incluidos 5 álbumes número 1 consecutivos en el Reino Unido (entre 1988 y 1994); 29 sencillos top 20, de los cuales 24 han sido top 20 consecutivamente (entre 1986 y 1997); incluyendo 17 sencillos Top 10, Erasure ha grabado más de 200 canciones y es la tercera banda en la historia del tecno pop que más discos ha vendido en el Reino Unido, solo detrás de Pet Shop Boys y Depeche Mode.","discografia":[{"any":"1986","album":"Wonderland"},{"any":"1987","album":"The Circus"},{"any":"1988","album":"The Innocents"},{"any":"1989","album":"Wild!"},{"any":"1991","album":"Chorus"},{"any":"1994","album":"I Say I Say I Say"},{"any":"1995","album":"Erasure"},{"any":"1997","album":"Cowboy"},{"any":"2000","album":"Loveboat"},{"any":"2003","album":"Other People\'s Songs"},{"any":"2005","album":"Nightbird"},{"any":"2006","album":"Union Street"},{"any":"2007","album":"Light at the End of the World"},{"any":"2011","album":"Tomorrow\'s World"},{"any":"2013","album":"Snow Globe"},{"any":"2014","album":"The Violet Flame"},{"any":"2017","album":"World Be Gone"},{"any":"2018","album":"World Beyond"},{"any":"2020","album":"The Neon"},{"any":"2022","album":"Day-Glo - Based On A True Story"}],"fotoGrup":"erasure.jpg","web":"erasure.com","credits":"wikipedia"},{"id":"9","nom":"Roosevelt","components":["Marius Lauber"],"estil":"Synth-pop, indie electronic, hypnagogic pop","anyFundacio":"2013","historia":"Su primer proyecto fue Beat!Beat!Beat!, una banda adolescente indie donde él era el baterista. Años más tarde la banda se separó y él se convirtió en solista.<br><br>Luego lanzó su aclamado EP debut \'Elliot\' en 2013. El sencillo principal \'Elliot\' fue nombrado como \'Best New Track\' de Pitchfork . Roosevelt luego lanzó la cara doble A \'Night Moves/Hold On\' en 2015 en Greco-Roman que continuó con un cálido sonido synth-pop con influencia balear .<br><br>En abril de 2016, anunció su álbum debut homónimo, cuyo lanzamiento está previsto para el 19 de agosto de 2016, en Greco-Roman/City Slang, con el vídeo de los temas \'Colours\' y \'Moving On\'. <br><br>Ha remezclado a artistas como Glass Animals , Jax Jones , Truls, Sundara Karma , Luka Vasta y Kakkmaddafakka , y en la gira ha apoyado a Hot Chip , Totally Enormous Extinct Dinosaurs y Crystal Fighters.<br><br>En junio de 2018, anunció un segundo álbum, Young Romance . Fue lanzado el 28 de septiembre de 2018. El primer sencillo de este álbum, \'Under the Sun\', fue lanzado el 27 de junio de 2018.<br><br>En marzo de 2019, lanzó \'Falling Back\' y una versión de \' Everywhere \' de Fleetwood Mac en W Records. Al año siguiente, \'Everywhere\' apareció en We Bare Bears: The Movie .<br><br>El 10 de junio de 2020, Roosevelt lanzó el sencillo Sign , que fue el primer material original desde su segundo álbum Young Romance . Roosevelt lanzó otros cuatro sencillos (Echoes, Feels Right, Strangers & Lovers) antes de su tercer álbum de estudio, Polydans, que se lanzó el 26 de febrero de 2021.","discografia":[{"any":"2016","album":"Roosevelt"},{"any":"2018","album":"Young Romance"},{"any":"2021","album":"Polydans"}],"fotoGrup":"roosevelt.jpg","web":"iammroosevelt.com","credits":"wikipedia"},{"id":"10","nom":"Dire Straits","components":["Mark Knopfler","John Illsley","Alan Clark","Guy Fletcher","David Knopfler","Pick Withers"],"estil":"Roots rock, Blues rock, Rock and roll, Pop rock","anyFundacio":"1977","historia":"Dire Straits (pronunciación: /daɪr streɪts/) fue una banda de rock británica formada en Londres en 1977 por Mark Knopfler (voz principal y guitarra principal), David Knopfler (guitarra rítmica y coros), John Illsley (bajo y coros) y Pick Withers (batería y percusión), estando activos hasta el año 1995. Dire Straits es considerado como uno de los grupos musicales más exitosos de la historia de la música rock.<br><br>Su primer sencillo, \'Sultans of Swing\', de su álbum debut homónimo de 1978, llegó a los diez primeros en las listas de éxitos del Reino Unido y los Estados Unidos. Le siguieron éxitos como \'Romeo and Juliet\' (1981), \'Private Investigations\' (1982), \'Twisting by the Pool\' (1983), \'Money for Nothing\' (1985) y \'Walk of Life\' (1985). Su álbum de mayor éxito comercial, Brothers in Arms (1985), ha vendido más de 30 millones de copias; fue el primer álbum en vender un millón de copias en disco compacto y es el octavo álbum más vendido en la historia del Reino Unido. Según el Guinness Book of British Hit Albums, Dire Straits ha pasado más de 1100 semanas en la lista de álbumes del Reino Unido, la quinta mayor cantidad de todos los tiempos.<br><br>El sonido de Dire Straits —cuyo nombre, según el mismo Mark Knopfler, en inglés significa «situación desesperada» o «estar en apuros»— se basa en varias influencias, incluyendo jazz, folk y country y el blues rock de J. J. Cale y Eric Clapton.Su sonido despojado contrastaba con el punk rock y demostraba una influencia del roots rock que surgió del pub rock. Hubo varios cambios en el personal, con Mark Knopfler e Illsley siendo los únicos miembros consistentes. Después de disolverse en 1995, Knopfler lanzó su carrera en solitario a tiempo completo. Dire Straits ganó cuatro premios Grammy, tres Brit Awards (Mejor grupo británico dos veces), dos MTV Video Music Awards y varios otros premios. Fueron incluidos en el Salón de la Fama del Rock and Roll en 2018.","discografia":[{"any":"1978","album":"Dire Straits"},{"any":"1979","album":"Communiqué"},{"any":"1980","album":"Making Movies"},{"any":"1982","album":"Love Over Gold"},{"any":"1985","album":"Brothers in Arms"},{"any":"1991","album":"On Every Street"}],"fotoGrup":"direstraits.jpg","web":"direstraits.com","credits":"wikipedia"},{"id":"11","nom":"Talk Talk","components":["Mark Hollis","Paul Webb","Lee Harris"],"estil":"Post-rock, Art rock,Synth pop, Art pop, New romantic, New wave","anyFundacio":"1981","historia":"Talk Talk fue una banda inglesa de rock formada en 1981 en Londres, y disuelta en 1991. En el comienzo de su carrera el grupo fue encasillado dentro del estilo denominado synth pop. Sin embargo, el grupo siguió luego una línea más experimental, y sus últimos álbumes fueron considerados por la crítica como precursores del post-rock.1​ A pesar de que los críticos recibieron favorablemente a los últimos álbumes de la banda, los mismos tuvieron poco éxito en el mercado, lo que contribuyó a una disputa entre la banda y la compañía discográfica EMI.<br><br>Los integrantes del grupo fueron el cantante y multi-instrumentista Mark Hollis, el bajista y corista Paul Webb, el baterista Lee Harris y el tecladista Simon Brenner. El productor Tim Friese-Greene desempeñó un papel importante en la evolución artística del grupo, además de tocar sintetizadores y colaborar en la composición.","discografia":[{"album":"The Party\'s Over","any":"1982"},{"album":"It\'s My Life","any":"1984"},{"album":"The Colour of Spring","any":"1986"},{"album":"Spirit of Eden","any":"1988"},{"album":"Laughing Stock","any":"1991"}],"fotoGrup":"talktalk.jpg","web":"#","credits":"wikipedia"},{"id":"12","nom":"Yazoo","components":["Vince Clarke","Alison Moyet"],"estil":"Synth pop","anyFundacio":"1981","historia":"Yazoo (conocidos como Yaz en Estados Unidos, por razones legales que involucraban a la compañía discográfica Yazoo Records) fue un dúo británico de synth pop originarios de Basildon, Essex, Inglaterra, cuya carrera tuvo gran éxito comercial al principio de los años 1980. Aunque no tuvieron la misma suerte en Estados Unidos, Yazoo alcanzó tres Top 10 en el UK Singles a inicios de esa década<br><br>Se formó a finales de 1981 por el excompositor de Depeche Mode, Vince Clarke (sintetizador) y por Alison Moyet (vocalista).","discografia":[{"any":"1982","album":"Upstairs at Eric\'s"},{"any":"1983","album":"You and Me Both"}],"fotoGrup":"yazoo.jpg","web":"#","credits":"wikipedia"}]')}));
